<!doctype html>

<html lang="en">
<head>
    <meta charset="utf-8">

    <title>Tabbie.org and GDPR</title>
    <meta name="description" content="Tabbie.org and GDPR">
    <meta name="author" content="SitePoint">
    <style>
        /* -------------------------------------
    GLOBAL
    A very basic CSS reset
------------------------------------- */
        * {
            margin: 0;
            font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
            box-sizing: border-box;
            font-size: 14px;
        }

        img {
            max-width: 100%;
        }

        body {
            -webkit-font-smoothing: antialiased;
            -webkit-text-size-adjust: none;
            width: 100% !important;
            height: 100%;
            line-height: 1.6em;
            /* 1.6em * 14px = 22.4px, use px to get airier line-height also in Thunderbird, and Yahoo!, Outlook.com, AOL webmail clients */
            /*line-height: 22px;*/
        }

        /* Let's make sure all tables have defaults */
        table td {
            vertical-align: top;
        }

        /* -------------------------------------
            BODY & CONTAINER
        ------------------------------------- */
        body {
            background-color: #f6f6f6;
        }

        .body-wrap {
            background-color: #f6f6f6;
            width: 100%;
        }

        .container {
            display: block !important;
            max-width: 600px !important;
            margin: 0 auto !important;
            /* makes it centered */
            clear: both !important;
        }

        .content {
            max-width: 600px;
            margin: 0 auto;
            display: block;
            padding: 20px;
        }

        /* -------------------------------------
            HEADER, FOOTER, MAIN
        ------------------------------------- */
        .main {
            background-color: #fff;
            border: 1px solid #e9e9e9;
            border-radius: 3px;
        }

        .content-wrap {
            padding: 20px;
        }

        .content-block {
            padding: 0 0 20px;
        }

        .header {
            width: 100%;
            margin-bottom: 20px;
        }

        .footer {
            width: 100%;
            clear: both;
            color: #999;
            padding: 20px;
        }
        .footer p, .footer a, .footer td {
            color: #999;
            font-size: 12px;
        }

        /* -------------------------------------
            TYPOGRAPHY
        ------------------------------------- */
        h1, h2, h3 {
            font-family: "Helvetica Neue", Helvetica, Arial, "Lucida Grande", sans-serif;
            color: #000;
            margin: 40px 0 0;
            line-height: 1.2em;
            font-weight: 400;
        }

        h1 {
            font-size: 32px;
            font-weight: 500;
            /* 1.2em * 32px = 38.4px, use px to get airier line-height also in Thunderbird, and Yahoo!, Outlook.com, AOL webmail clients */
            /*line-height: 38px;*/
        }

        h2 {
            font-size: 24px;
            /* 1.2em * 24px = 28.8px, use px to get airier line-height also in Thunderbird, and Yahoo!, Outlook.com, AOL webmail clients */
            /*line-height: 29px;*/
        }

        h3 {
            font-size: 18px;
            /* 1.2em * 18px = 21.6px, use px to get airier line-height also in Thunderbird, and Yahoo!, Outlook.com, AOL webmail clients */
            /*line-height: 22px;*/
        }

        h4 {
            font-size: 14px;
            font-weight: 600;
        }

        p, ul, ol {
            margin-bottom: 10px;
            font-weight: normal;
        }
        p li, ul li, ol li {
            margin-left: 5px;
            list-style-position: inside;
        }

        /* -------------------------------------
            LINKS & BUTTONS
        ------------------------------------- */
        a {
            color: #348eda;
            text-decoration: underline;
        }

        .btn-primary {
            text-decoration: none;
            color: #FFF;
            background-color: #348eda;
            border: solid #348eda;
            border-width: 10px 20px;
            line-height: 2em;
            /* 2em * 14px = 28px, use px to get airier line-height also in Thunderbird, and Yahoo!, Outlook.com, AOL webmail clients */
            /*line-height: 28px;*/
            font-weight: bold;
            text-align: center;
            cursor: pointer;
            display: inline-block;
            border-radius: 5px;
            text-transform: capitalize;
        }

        /* -------------------------------------
            OTHER STYLES THAT MIGHT BE USEFUL
        ------------------------------------- */
        .last {
            margin-bottom: 0;
        }

        .first {
            margin-top: 0;
        }

        .aligncenter {
            text-align: center;
        }

        .alignright {
            text-align: right;
        }

        .alignleft {
            text-align: left;
        }

        .clear {
            clear: both;
        }

        /* -------------------------------------
            ALERTS
            Change the class depending on warning email, good email or bad email
        ------------------------------------- */
        .alert {
            font-size: 16px;
            color: #fff;
            font-weight: 500;
            padding: 20px;
            text-align: center;
            border-radius: 3px 3px 0 0;
        }
        .alert a {
            color: #fff;
            text-decoration: none;
            font-weight: 500;
            font-size: 16px;
        }
        .alert.alert-warning {
            background-color: #000000;
        }
        .alert.alert-bad {
            background-color: #D0021B;
        }
        .alert.alert-good {
            background-color: #68B90F;
        }

        /* -------------------------------------
            INVOICE
            Styles for the billing table
        ------------------------------------- */
        .invoice {
            margin: 40px auto;
            text-align: left;
            width: 80%;
        }
        .invoice td {
            padding: 5px 0;
        }
        .invoice .invoice-items {
            width: 100%;
        }
        .invoice .invoice-items td {
            border-top: #eee 1px solid;
        }
        .invoice .invoice-items .total td {
            border-top: 2px solid #333;
            border-bottom: 2px solid #333;
            font-weight: 700;
        }

        /* -------------------------------------
            RESPONSIVE AND MOBILE FRIENDLY STYLES
        ------------------------------------- */
        @media only screen and (max-width: 640px) {
            body {
                padding: 0 !important;
            }

            h1, h2, h3, h4 {
                font-weight: 800 !important;
                margin: 20px 0 5px !important;
            }

            h1 {
                font-size: 22px !important;
            }

            h2 {
                font-size: 18px !important;
            }

            h3 {
                font-size: 16px !important;
            }

            .container {
                padding: 0 !important;
                width: 100% !important;
            }

            .content {
                padding: 0 !important;
            }

            .content-wrap {
                padding: 10px !important;
            }

            .invoice {
                width: 100% !important;
            }
        }
    </style>
</head>
<body itemscope itemtype="http://schema.org/EmailMessage">

<table class="body-wrap">
    <tr>
        <td></td>
        <td class="container" width="600">
            <div class="content">
                <table class="main" width="100%" cellpadding="0" cellspacing="0">
                    <tr>
                        <td class="alert alert-warning">
                            <img src="data:image/png;base64,"/>
                            If you want to keep your Tabbie.org results and data, act now!
                        </td>
                    </tr>
                    <tr>
                        <td class="content-wrap">
                            <table width="100%" cellpadding="0" cellspacing="0">
                                <tr>
                                    <td class="content-block">
                                        The EU General Data Protection Regulation (GDPR) means that we need your consent to continue storing your data on Tabbie.org. Tabbie is strongly committed to protecting the privacy of the personal data that we need to run efficient debating competitions around the world. In preparation for 25 May 2018, when the EU's General Data Protection Regulation will be enforced, we would like you to verify that you are still happy to have the results of your past debating competitions stored on Tabbie.org.
                                    </td>
                                </tr>
                                <tr>
                                    <td class="content-block">
                                        <h3>Can I Ignore This?</h3>
                                        If you don't want to use your Tabbie.org account again, and don't want your debating history to be easily available online, then you can delete this email. We won't bother you again.
                                    </td>
                                </tr><tr>
                                    <td class="content-block">
                                        <h3>What is the 'General Data Protection Regulation (GDPR)’?</h3>
                                        The General Data Protection Regulation (GDPR) is a legal framework that sets guidelines for the collection and processing of personal information of individuals within the European Union. The GDPR sets out the principles for data management and the rights of the individual, while also imposing fines that can be revenue-based. While Tabbie doesn’t make any revenue, we are still covered, and we are seeking to adopt best practices. The General Data Protection Regulation covers all companies that deal with data of EU citizens, and will come into effect across the EU on May 25, 2018.
                                    </td>
                                </tr>
                                <tr>
                                    <td class="content-block">
                                        <h3>Why do we want your consent?</h3>
                                        First and foremost to publish tabs, so that people can see the information relating to your performance in previous competitions.
                                        Secondly, to do large-scale analysis over competitions, so that we can track performance between competitions.
                                        For example, using the <a href="http://mdr.monashdebaters.com/volume-12-2014/introducing-elo-ratings-in-british-parliamentary-debating/">proposal made by Ashish and MDG in the MDR</a>, we have been able to create a rudimentary rating system to discover who has been the best BP debater in the world by Tabbie rating since 2015 (the list will be published if and when I receive the consent of all of the world-ranked number 1s (they know who they are!!)).
                                    </td>
                                </tr>
                                <tr>
                                    <td class="content-block">
                                        <h3>How do you consent?</h3>
                                        Log into your Tabbie account, and click on the big red 'Update GDPR Settings' button. You will be taken to your ‘edit data’ page, where you can give your consent.
                                        <br />
                                        <img align="middle" width="100%" src="data:image/png;base64," />
                                        <br />
                                        <hr />
                                        <br />
                                        <img align="middle" width="100%" src="data:image/png;base64," />
                                        <br />
                                        If you don’t wish to give your consent, that’s fine. We will erase all of the data associated with your account (including, but not limited to, name, gender preferences, institutional history, clash lists, previous tab performance and email) the day that GDPR comes into effect. This will have the effect of retroactively erasing this data from all past tabs on the website.

                                        If you miss this opportunity, you will have to manually re-enter your data, but if you consent now, you are able to opt out of the system at any time in the future.
                                    </td>
                                </tr>
                                <tr>
                                    <td class="content-block">
                                        If you have any questions, please email me at <a href="mailto:richard@tabbie.org?Subject=GDPR%20Information">richard.tabbie@gmail.com</a>. Please do not reply to this email.
                                    </td>
                                </tr>
                            </table>
                        </td>
                    </tr>
                </table>
                <div class="footer">
                    <table width="100%">
                        <tr>
                            <td class="aligncenter content-block"><a href="http://www.tabbie.org">Thanks for using Tabbie.org.</td>
                        </tr>
                    </table>
                </div></div>
        </td>
        <td></td>
    </tr>
</table>

</body>
</html>